import React, { useState } from "react";
const SResult = () =>{

    const [img, setImg] = useState("");
    const InputEvent = (event) =>{
    const data = event.target.value;
    setImg(data);
    console.log(data);
    }
    return(
        <>
        <h1>SResult Page </h1>
        <input
            type="text"
            placeholder="Enter Some Text"
            onChange={InputEvent}
            value={img}
        />
        </>
    );
}
export default SResult;
